import jsPDF from "jspdf";
import autoTable from "jspdf-autotable";
//  CORRECCIN TS: Importaci贸n del tipo HookData de jspdf-autotable para didDrawPage
import { HookData } from "jspdf-autotable";

// --- Tipos de Datos (Interfaces necesarias para el hook) ---

interface QuoteItem {
  SKU: string;
  "NOMBRE PRODUCTO": string;
  REFERENCIA: string;
  "PRECIO VENTA": number;
  "Cantidad unds": number;
  // Campos de cotizaci贸n
  quoteQuantity: number;
  quotePrice: number;
}

interface ClientDetails {
  name: string;
  company: string;
  email: string;
}

interface QuoteDetails {
  validityDays: number;
  finalMessage: string;
}

interface QuoteTotals {
  subtotal: number;
  iva: number;
  total: number;
}

interface CompanyInfo {
  name: string;
  address: string;
  phone: string;
  email: string;
  website: string;
}

//  CORRECCIN TS: Interfaz para tipar el objeto doc con extensiones de autoTable
// Esto elimina los errores de "Unexpected any" al usar 'putTotalPages' y 'lastAutoTable'.
interface JsPdfWithAutotable extends jsPDF {
  putTotalPages?: (totalPages: string) => void;
  lastAutoTable: {
    finalY: number;
  };
}

// --- CONSTANTE DE INFORMACIN DE LA EMPRESA ---
const companyInfo: CompanyInfo = {
  name: "Tu Empresa S.A.S.",
  address: "Carrera 10 #20-30, Duitama, Boyac谩",
  phone: "+57 310 123 4567",
  email: "ventas@tuempresa.com",
  website: "www.tuempresa.com",
};

// Define el tipo de tupla mutable que jspdf espera para colores RGB
type RgbColor = [number, number, number];

// --- Custom Hook para Generar PDF ---
export const usePdfGenerator = () => {
  // Paleta de colores
  const colors = {
    //  CORRECCIN TS: Se usa la aserci贸n RgbColor (mutable) para resolver el error 2322.
    primary: [233, 30, 99] as RgbColor,
    accent: [212, 175, 55] as RgbColor,
    darkText: [26, 26, 26] as RgbColor,
    secondaryText: [100, 116, 139] as RgbColor,
    borderColor: [221, 221, 221] as RgbColor,
  };

  /**
   * Genera el PDF de la cotizaci贸n y retorna un Blob URL y la metadata.
   * @param items Items de la cotizaci贸n.
   * @param client Detalles del cliente.
   * @param details Detalles de la cotizaci贸n.
   * @param totals Totales de la cotizaci贸n.
   * //  CORRECCIN 1: Se elimin贸 'logoBase64' para corregir el warning de "defined but never used" (L铆nea 81).
   */
  const generatePdf = (
    items: QuoteItem[],
    client: ClientDetails,
    details: QuoteDetails,
    totals: QuoteTotals
  ) => {
    // 1. Preparar datos finales (Mismo c贸digo)
    const finalClientName = client.name.trim() || "Cliente Preferencial";
    const finalClientFirstName = finalClientName.split(" ")[0];
    const finalMsg = details.finalMessage.replace(
      /{cliente}/gi,
      finalClientFirstName
    );
    const finalClient = { ...client, name: finalClientName };
    const finalDetails = { ...details, finalMessage: finalMsg };

    // 2. Generar IDs y Nombre de Archivo (Mismo c贸digo)
    const quoteNumber = `COT-${new Date().getFullYear()}-${String(
      Date.now()
    ).slice(-6)}`;
    const emissionDate = new Date().toLocaleDateString("es-CO", {
      year: "numeric",
      month: "long",
      day: "numeric",
    });

    const safeClientName = finalClientName
      .replace(/[^a-z0-9]/gi, "_")
      .toLowerCase();
    const dateString = new Date().toISOString().split("T")[0]; // YYYY-MM-DD
    const fileName = `Cotizacion_${quoteNumber}_${safeClientName}_${dateString}.pdf`;

    // 3. --- LGICA DE JSPDF ---
    //  CORRECCIN 2: Tipado correcto de 'doc' con la nueva interfaz.
    const doc = new jsPDF() as JsPdfWithAutotable;
    const pageMargin = 15;
    const pageWidth = doc.internal.pageSize.getWidth();
    const contentWidth = pageWidth - pageMargin * 2;
    const headerY = 20;

    // --- ENCABEZADO ---
    const logoSize = 35;
    const radius = 5; // Radio de borde para el logo

    doc.setDrawColor(...colors.borderColor);
    doc.setLineWidth(0.25);

    // Usar doc.roundedRect para el borde del logo
    doc.roundedRect(
      pageMargin,
      headerY,
      logoSize,
      logoSize,
      radius,
      radius,
      "S"
    );

    // --- LOGO ESTTICO ---
    try {
      //  CORRECCIN DE REFERENCIA: Se asegura de que la variable exista.
      // Reemplaza esta cadena con tu Base64 REAL.
      const staticLogoBase64 =
        "data:image/png;base64,";

      //  NOTA IMPORTANTE: Si ves el error "wrong PNG signature",
      // significa que la cadena Base64 que pegaste en 'staticLogoBase64' est谩 truncada o corrupta.
      // Debes asegurarte de que la cadena sea completa y correcta.
      doc.addImage(
        staticLogoBase64,
        "PNG", // o "JPEG" si tu logo es jpg
        pageMargin + 1,
        headerY + 1,
        logoSize - 2,
        logoSize - 2
      );
    } catch (e) {
      console.error("Error al a帽adir la imagen del logo est谩tico:", e);
      doc.setFontSize(8);
      doc.setTextColor(...colors.secondaryText);
      doc.text(
        "LOGO (Error)",
        pageMargin + logoSize / 2,
        headerY + logoSize / 2,
        {
          align: "center",
          baseline: "middle",
        }
      );
    }

    // Informaci贸n de la empresa (Mismo c贸digo)
    const companyX = pageMargin + logoSize + 10;
    doc.setFontSize(16);
    doc.setFont("helvetica", "bold");
    doc.setTextColor(...colors.primary);
    doc.text(companyInfo.name, companyX, headerY + 8);
    doc.setFontSize(9);
    doc.setFont("helvetica", "normal");
    doc.setTextColor(...colors.darkText);
    doc.text(companyInfo.address, companyX, headerY + 14);
    doc.text(
      `${companyInfo.phone}  ${companyInfo.email}`,
      companyX,
      headerY + 19
    );

    // T铆tulo "COTIZACIN" y n煤meros (Mismo c贸digo)
    doc.setFontSize(20);
    doc.setFont("helvetica", "bold");
    doc.setTextColor(...colors.primary);
    doc.text("COTIZACIN", pageWidth - pageMargin, headerY + 8, {
      align: "right",
    });
    doc.setFontSize(11);
    doc.setFont("helvetica", "normal");
    doc.setTextColor(...colors.secondaryText);
    doc.text(quoteNumber, pageWidth - pageMargin, headerY + 16, {
      align: "right",
    });
    doc.text(emissionDate, pageWidth - pageMargin, headerY + 22, {
      align: "right",
    });

    // L铆nea decorativa (Mismo c贸digo)
    doc.setDrawColor(...colors.accent);
    doc.setLineWidth(0.5);
    doc.line(
      pageMargin,
      headerY + logoSize + 5,
      pageWidth - pageMargin,
      headerY + logoSize + 5
    );

    // --- INFORMACIN DEL CLIENTE Y VALIDEZ (Mismo c贸digo) ---
    const clientSectionY = headerY + logoSize + 15;
    const clientBoxHeight = 35;
    const halfWidth = contentWidth / 2 - 5;
    const detailsX = pageMargin + halfWidth + 10;

    // Caja del Cliente
    doc.setDrawColor(...colors.borderColor);
    doc.setLineWidth(0.25);
    doc.rect(pageMargin, clientSectionY, halfWidth, clientBoxHeight, "S");
    doc.setFontSize(10);
    doc.setFont("helvetica", "bold");
    doc.setTextColor(...colors.primary);
    doc.text("CLIENTE", pageMargin + 5, clientSectionY + 8);
    doc.setFontSize(12);
    doc.setFont("helvetica", "bold");
    doc.setTextColor(...colors.darkText);
    doc.text(finalClient.name, pageMargin + 5, clientSectionY + 16);

    let currentClientY = clientSectionY + 22;
    if (finalClient.company) {
      doc.setFontSize(10);
      doc.setFont("helvetica", "normal");
      doc.setTextColor(...colors.darkText);
      doc.text(finalClient.company, pageMargin + 5, currentClientY);
      currentClientY += 6;
    }
    if (finalClient.email) {
      doc.setFontSize(8);
      doc.setFont("helvetica", "normal");
      doc.setTextColor(...colors.secondaryText);
      doc.text(finalClient.email, pageMargin + 5, currentClientY);
    }

    // Caja de Validez
    doc.setDrawColor(...colors.borderColor);
    doc.setLineWidth(0.25);
    doc.rect(detailsX, clientSectionY, halfWidth, clientBoxHeight, "S");
    doc.setFontSize(10);
    doc.setFont("helvetica", "bold");
    doc.setTextColor(...colors.primary);
    doc.text("VALIDEZ DE OFERTA", detailsX + 5, clientSectionY + 8);
    doc.setFontSize(12);
    doc.setFont("helvetica", "bold");
    doc.setTextColor(...colors.darkText);
    doc.text(
      `${finalDetails.validityDays} d铆as h谩biles`,
      detailsX + halfWidth - 5,
      clientSectionY + 16,
      { align: "right" }
    );

    // --- TABLA DE PRODUCTOS (JSPDF-AUTOTABLE) ---
    const tableStartY = clientSectionY + clientBoxHeight + 10;
    //  MODIFICACIN 1: Se elimin贸 "REF."
    const tableHead = [["#", "PRODUCTO", "CANT.", "VLR. UNIT.", "TOTAL"]];

    const tableBody = items.map((item, index) => [
      index + 1,
      item["NOMBRE PRODUCTO"],
      //  MODIFICACIN 2: Se elimin贸 item.REFERENCIA
      item.quoteQuantity.toString(),
      item.quotePrice.toLocaleString("es-CO", {
        style: "currency",
        currency: "COP",
        maximumFractionDigits: 0,
      }),
      (item.quotePrice * item.quoteQuantity).toLocaleString("es-CO", {
        style: "currency",
        currency: "COP",
        maximumFractionDigits: 0,
      }),
    ]);

    autoTable(doc, {
      startY: tableStartY,
      head: tableHead,
      body: tableBody,
      theme: "grid",
      headStyles: {
        //  CORRECCIN TS: El tipo mutable es compatible aqu铆.
        fillColor: colors.primary,
        textColor: [255, 255, 255],
        fontStyle: "bold",
        fontSize: 9,
        cellPadding: 4,
        halign: "center",
      },
      bodyStyles: {
        fontSize: 9,
        cellPadding: 3,
        textColor: colors.darkText,
      },
      alternateRowStyles: {
        fillColor: [248, 249, 250],
      },
      //  MODIFICACIN 3: Se ajustaron los anchos de columna (PRODUCTO creci贸 de 60 a 85)
      columnStyles: {
        0: { cellWidth: 10, halign: "center" }, // #
        1: { cellWidth: 85, halign: "left" }, // PRODUCTO (Antes 60 + 25 de REF)
        2: { cellWidth: 15, halign: "center" }, // CANT. (Antes 铆ndice 3)
        3: { cellWidth: 35, halign: "right" }, // VLR. UNIT. (Antes 铆ndice 4)
        4: { cellWidth: 35, halign: "right", fontStyle: "bold" }, // TOTAL (Antes 铆ndice 5)
      },
      styles: {
        //  CORRECCIN TS: El tipo mutable es compatible aqu铆.
        lineColor: colors.borderColor,
        lineWidth: 0.1,
      },
      margin: { left: pageMargin, right: pageMargin },
      //  CORRECCIN 3: Uso del tipo HookData y eliminaci贸n de 'data' sin uso (L铆nea 320).
      didDrawPage: (hookData: HookData) => {
        doc.setFontSize(8);
        doc.setTextColor(...colors.secondaryText);
        let str = `P谩gina ${doc.getNumberOfPages()}`;
        //  CORRECCIN 4: Uso de tipado correcto para 'doc' (L铆nea 324).
        if (doc.putTotalPages) {
          str = str + " de {totalPages}";
        }
        doc.text(str, pageWidth / 2, 287, { align: "center" });
      },
    });

    //  CORRECCIN 5: Uso de tipado correcto para 'doc' (L铆nea 331-336).
    if (doc.putTotalPages) {
      doc.putTotalPages("{totalPages}");
    }

    // --- SECCIN DE TOTALES (Mismo c贸digo) ---
    //  CORRECCIN 6: Uso de tipado correcto para 'doc' (L铆nea 337).
    const finalY = doc.lastAutoTable.finalY || 100;
    let currentY = finalY + 10;
    const totalsLabelX = pageWidth - pageMargin - 40;
    const totalsValueX = pageWidth - pageMargin;

    // Subtotal
    doc.setFontSize(10);
    doc.setFont("helvetica", "normal");
    doc.setTextColor(...colors.darkText);
    doc.text("Subtotal:", totalsLabelX, currentY, { align: "right" });
    doc.text(
      totals.subtotal.toLocaleString("es-CO", {
        style: "currency",
        currency: "COP",
        maximumFractionDigits: 0,
      }),
      totalsValueX,
      currentY,
      { align: "right" }
    );

    // IVA
    if (totals.iva > 0) {
      currentY += 7;
      doc.text("IVA (19%):", totalsLabelX, currentY, { align: "right" });
      doc.text(
        totals.iva.toLocaleString("es-CO", {
          style: "currency",
          currency: "COP",
          maximumFractionDigits: 0,
        }),
        totalsValueX,
        currentY,
        { align: "right" }
      );
    }

    // Separador y Total Final
    currentY += 5;
    doc.setDrawColor(...colors.borderColor);
    doc.setLineWidth(0.25);
    doc.line(totalsLabelX - 10, currentY, totalsValueX, currentY);
    currentY += 8;
    doc.setFontSize(14);
    doc.setFont("helvetica", "bold");
    doc.setTextColor(...colors.primary);
    doc.text("TOTAL:", totalsLabelX, currentY, { align: "right" });
    doc.text(
      totals.total.toLocaleString("es-CO", {
        style: "currency",
        currency: "COP",
        maximumFractionDigits: 0,
      }),
      totalsValueX,
      currentY,
      { align: "right" }
    );

    // --- NOTAS Y MENSAJE (Mismo c贸digo) ---
    const totalsEndBoundary = currentY + 5;
    let notesY = Math.max(finalY + 10, totalsEndBoundary);
    const notesColWidth = contentWidth / 2 - 5;

    // Mensaje persuasivo
    doc.setFontSize(10);
    doc.setFont("helvetica", "italic");
    doc.setTextColor(...colors.darkText);
    const persuasiveMessage = `隆${finalClientFirstName}, gracias por elegirnos! Esperamos que estos productos resalten a煤n m谩s tu belleza. Estamos a su disposici贸n.`;
    const messageLines = doc.splitTextToSize(persuasiveMessage, notesColWidth);
    doc.text(messageLines, pageMargin, notesY);
    notesY += messageLines.length * 5 + 8;

    // Notas adicionales
    if (finalDetails.finalMessage) {
      doc.setFontSize(10);
      doc.setFont("helvetica", "bold");
      doc.setTextColor(...colors.primary);
      doc.text("NOTAS ADICIONALES:", pageMargin, notesY);

      doc.setFontSize(9);
      doc.setFont("helvetica", "normal");
      doc.setTextColor(...colors.darkText);
      const userMessageLines = doc.splitTextToSize(
        finalDetails.finalMessage,
        notesColWidth
      );
      doc.text(userMessageLines, pageMargin, notesY + 6);
    }

    // --- PIE DE PGINA (Mismo c贸digo) ---
    const footerY = 270;
    doc.setDrawColor(...colors.borderColor);
    doc.setLineWidth(0.25);
    doc.line(pageMargin, footerY, pageWidth - pageMargin, footerY);

    doc.setFontSize(9);
    doc.setFont("helvetica", "bold");
    doc.setTextColor(...colors.darkText);
    doc.text(
      `隆Gracias por tu inter茅s en ${companyInfo.name}! Realza tu belleza con nosotros.`,
      pageWidth / 2,
      footerY + 8,
      { align: "center" }
    );

    doc.setFontSize(8);
    doc.setFont("helvetica", "normal");
    doc.setTextColor(...colors.secondaryText);
    doc.text(
      `Esta cotizaci贸n es v谩lida por ${finalDetails.validityDays} d铆as. Precios sujetos a cambio.`,
      pageWidth / 2,
      footerY + 13,
      { align: "center" }
    );

    // 4. Generar Blob
    const pdfBlob = doc.output("blob");
    const pdfUrl = URL.createObjectURL(pdfBlob);

    return {
      blobUrl: pdfUrl,
      quoteNumber,
      fileName,
    };
  };

  return { generatePdf };
};
